import React from 'react';

const InfoGym = () => {
  return (
    <div className="gyms">
      <div className='imgGym'>
        <img src='https://res.cloudinary.com/drnmx4xgd/image/upload/v1685371157/ImagenC_davwiy.png'/>
      </div>
      <div className='information'></div>
    </div>
  );
}

export default InfoGym;
